        #region EventHandlers

        private void CtlQueryWhUB_Load(object sender, EventArgs e)
        {
            // Buchungsstati laden im Grid und edtSucheStatus
            repositoryItemImageComboBox1.SmallImages = KissImageList.SmallImageList;
            SqlQuery qryStati = DBUtil.OpenSQL("select * from XLOVCode where LOVName = 'KbBuchungsStatus' order by SortKey");

            edtSucheStatus.Properties.SmallImages = KissImageList.SmallImageList;
            edtSucheStatus.Properties.Items.Add(new ImageComboBoxItem("", null, -1));

            foreach (DataRow row in qryStati.DataTable.Rows)
            {
                var statusCode = (int)row["Code"];
                var item = new ImageComboBoxItem(row["Text"].ToString(), statusCode, KissImageList.GetImageIndex(Convert.ToInt32(row["Value1"])));
                repositoryItemImageComboBox1.Items.Add(item);

                if (statusCode == 3 ||  // ZahlauftragErstellt
                    statusCode == 10 || // teilweise ausgeglichen
                    statusCode == 6 ||  // ausgeglichen
                    statusCode == 8)   // storniert
                {
                    edtSucheStatus.Properties.Items.Add(item);
                }
            }

            colDetailStat.ColumnEdit = colMainStat.ColumnEdit;
        }

        private void btnMonatsbudget_Click(object sender, EventArgs e)
        {
            try
            {
                string jumpToPath = string.Format(
                    "ClassName=FrmFall;" +
                    "BaPersonID={0};" +
                    "ModulID=3;",
                    qryQuery["FallBaPersonID"]);
                if (!DBUtil.IsEmpty(qryQuery["BgFinanzplanID"]))
                {
                    jumpToPath += string.Format("TreeNodeID=CtlWhFinanzplan{0}", qryQuery["BgFinanzplanID"]);
                    if (!DBUtil.IsEmpty(qryQuery["BgBudgetID"]))
                    {
                        jumpToPath += string.Format("\\BBG{0};", qryQuery["BgBudgetID"]);
                        if (!DBUtil.IsEmpty(qryQuery["BgPositionID"]))
                        {
                            jumpToPath += string.Format("ActiveSQLQuery.Find=BgPositionID = {0};", qryQuery["BgPositionID"]);
                        }
                    }
                    else
                        jumpToPath += ';';
                }

                System.Collections.Specialized.HybridDictionary dic = FormController.ConvertToDictionary(jumpToPath);
                bool result = FormController.OpenForm((string)dic["ClassName"], "Action", "JumpToPath", dic);
                // resultat ist eigentlich immer true
                if (!result)
                {
                    KissMsg.ShowInfo("Das Budget befindet sich in einer beendeten Reg. WH oder in einem abgeschlossenen W. Deaktivieren Sie die Optionen 'Beendete Reg. WH ausblenden' und 'Abgeschlossene W ausblenden' um das Budget anzuzeigen.");
                }
            }
            catch (Exception ex)
            {
                KissMsg.ShowInfo(ex.Message);
            }
            // End Rule
        }

        private void qryQuery_AfterFill(object sender, EventArgs e)
        {
            // Keine Person ausgewhlt => Gruppierung
            DataSet ds = qryQuery.DataSet;
            ds.EnforceConstraints = false; // Workaround: das SqlQuery lscht die Constraints nur auf der zweiten Table, nicht jedoch auf der ersten
            // Beim ersten Durchgang ohne die Option 'verdichtet' (mit vorgngigen Suchvorgngen mit verdichtet) gibt es dadurch eine exception.
            try
            {
                ds.Relations.Add("Level1",
                    new DataColumn[] { ds.Tables[0].Columns["KbBuchungBruttoID"], ds.Tables[0].Columns["BgPositionID"] },
                    new DataColumn[] { ds.Tables[1].Columns["KbBuchungBruttoID"], ds.Tables[1].Columns["BgPositionID"] });
            }
            catch (Exception ex)
            {
                // Eintrag ins Log (Ansicht unter Anwendung/Newod Schnittstelle/Protokolle)
                XLog.Create(GetType().FullName, LogLevel.ERROR, ex.Message);
            }
        }

        #endregion

        private void edtSucheStatus_EditValueChanged(object sender, EventArgs e)
        {
            var sucheStatusCode = Utils.ConvertToInt(edtSucheStatus.EditValue);
            if(sucheStatusCode == 8)
            {
                edtInklStornierterPositionen.EditMode = EditModeType.ReadOnly;
            }
            else
            {
                edtInklStornierterPositionen.EditMode = EditModeType.Normal;
            }
        }

